import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import './FeatureAnalysisResults.css';
import mangoLogo from '../../assets/Logo_white.png';
import userProfileImg from '../../assets/profile.jpg';

const FeatureAnalysisResults = () => {
    const navigate = useNavigate();
    const [tableData, setTableData] = useState([]);

    useEffect(() => {
        const storedFiles = localStorage.getItem('uploadedFiles');
        if (storedFiles) {
            setTableData(JSON.parse(storedFiles));
        }
    }, []);

    const handleDelete = (id) => {
        const updatedData = tableData.filter((row) => row.id !== id);
        setTableData(updatedData);
        localStorage.setItem('uploadedFiles', JSON.stringify(updatedData));
    };

    const handleAboutUs = () => navigate("/aboutuspage");
    const handleContactUs = () => navigate("/contactuspage");
    const handleUserProfile = () => navigate("/userprofilepage");
    const handleBack = () => navigate("/featureanalysis");
    const handleExportCSV = () => navigate("/exportfeaturesuccessful");
    const handleDashboard = () => navigate("/dashboardpage");
    const handleBruiseAreaCalculation = () => navigate("/bruiseareacalculation");
    const handleFeatureAnalysis = () => navigate("/featureanalysis");

    return (
        <div className="feature-analysis-results-page">
            <nav className="navbar-featureanalysisresults">
                <div className="navbar-brand">
                    <img src={mangoLogo} alt="Mango Logo" className="mango-logo" />
                </div>
                <div className="navbar-links">
                    <button className="navbar-link" onClick={handleDashboard}>Dashboard</button>
                    <button className="navbar-link" onClick={handleBruiseAreaCalculation}>Bruised Area Calculation</button>
                    <button className="navbar-link active" onClick={handleFeatureAnalysis}>Feature Analysis</button>
                    <button className="navbar-link">Resize</button>
                    <button className="navbar-link" onClick={handleAboutUs}>About Us</button>
                    <button className="navbar-link" onClick={handleContactUs}>Contact Us</button>
                </div>
                <div className="navbar-profile" onClick={handleUserProfile}>
                    <img src={userProfileImg} alt="User Profile" className="user-profile" />
                </div>
            </nav>

            <div className="feature-analysis-results-content">
                <h2 className="feature-analysis-results-title">Feature Analysis Results</h2>
                <div className="feature-analysis-results-table-container">
                    {tableData.length > 0 ? (
                        <table className="feature-analysis-results-table">
                            <thead>
                                <tr>
                                    <th>Image ID</th>
                                    <th>File Name</th>
                                    <th>File Size (KB)</th>
                                    <th>Delete</th>
                                </tr>
                            </thead>
                            <tbody>
                                {tableData.map((row) => (
                                    <tr key={row.id}>
                                        <td>{row.id}</td>
                                        <td>{row.name}</td>
                                        <td>{(row.size / 1024).toFixed(2)}</td>
                                        <td>
                                            <button className="btn delete-btn" onClick={() => handleDelete(row.id)}>Delete</button>
                                        </td>
                                    </tr>
                                ))}
                            </tbody>
                        </table>
                    ) : (
                        <p className="no-info">No information available</p>
                    )}
                </div>

                <div className="action-buttons">
                    <button className="btn back-btn" onClick={handleBack}>Back</button>
                    <button className="btn export-btn" onClick={handleExportCSV}>Export CSV</button>
                </div>
            </div>

            <footer className="footer-featureanalysisresults">
                <div className="footer-address-featureanalysisresults">
                    <p>Mae Fah Luang University 333 Moo 1, Thasud, Muang, Chiang Rai 57100</p>
                </div>
            </footer>
        </div>
    );
};

export default FeatureAnalysisResults;
